    { label: '-', value: -1 },
    { label: 'A1', value: 1 },
    { label: 'A2', value: 2 },
    { label: 'B1', value: 3 },
    { label: 'B2', value: 4 },
    { label: 'C1', value: 5 },
    { label: 'C2', value: 6 }
];
